// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract NFTMarket {
    struct Listing {
        address nftAddress;
        uint256 id;
        uint256 tokenId;
        address seller;
        uint256 price;
        uint256 starttimestamp;
        uint256 endTimestamp;
        address highestBidder;
        uint256 highestBidPrice;
    }

    struct Node {
        uint256 current;
        uint256 front;
        uint256 next;
        uint256 createTime;
    }

    address public vicDAO;

    address public VicAddress;

    mapping(uint256 => Node) public Nodes;

    mapping(uint256 => Listing) public listings;

    mapping(address => mapping(uint256 => uint256)) nftToIndex;

    mapping(address => uint) pendingReturns;

    uint256 public listingIdCounter;

    event ListingCreated(
        uint256 indexed listingId,
        address nftAddress,
        uint256 tokenId,
        uint256 createTime,
        uint256 endTime,
        address seller,
        uint256 price
    );

    event NftSold(
        uint256 indexed listingId,
        address nftAddress,
        uint256 tokenId,
        address seller,
        address buyer,
        uint256 price
    );

    event ListingCanceled(
        uint256 indexed listingId,
        address nftAddress,
        uint256 tokenId,
        address seller
    );

    event Bid(
        uint256 indexed listingId,
        address nftAddress,
        uint256 tokenId,
        uint256 bidPrice,
        address bidder
    );

    event Unsold(
        uint256 indexed listingId,
        address nftAddress,
        uint256 tokenId,
        uint256 price
    );

    modifier onlyVicDao() {
        require(msg.sender == vicDAO);
        _;
    }

    function createListing(
        address _nftAddress,
        uint256 _tokenId,
        uint256 _price
    ) external onlyVicDao {
        require(_price > 0, "Price must be positive");
        require(nftToIndex[_nftAddress][_tokenId] == 0, "Already listed");
        IERC721(_nftAddress).approve(address(this), _tokenId);
        listingIdCounter++;
                uint256 timestamp = block.timestamp;
        Nodes[listingIdCounter] = Node(
            listingIdCounter,
            listingIdCounter - 1,
            listingIdCounter + 1,
            timestamp
        );

        listings[listingIdCounter] = Listing(
            _nftAddress,
            listingIdCounter,
            _tokenId,
            msg.sender,
            _price,
            timestamp,
            timestamp + 48 hours,
            address(0),
            0
        );
        emit ListingCreated(
            listingIdCounter,
            _nftAddress,
            _tokenId,
            timestamp,
            timestamp,
            msg.sender,
            _price
        );
    }

    function bid(uint256 _listingId, uint256 _price) external {
        Listing storage listing = listings[_listingId];
        require(listing.id > 0, "Invalid listing");
        uint256 timestamp = block.timestamp;
        require(timestamp < listing.endTimestamp, "beyond the auction time");
        require(
            _price > listing.highestBidPrice,
            "less than the current maximum price"
        );
        IERC20(VicAddress).transfer(address(this), _price);
        pendingReturns[listing.highestBidder] = listing.highestBidPrice;
        listing.highestBidPrice = _price;
        listing.highestBidder = msg.sender;
    }

    function withdraw() external {
        uint amount = pendingReturns[msg.sender];
        if (amount > 0) {
            pendingReturns[msg.sender] = 0;
            IERC20(VicAddress).transfer(msg.sender, amount);
        }
    }

    function cancelListing(uint256 _listingId) external onlyVicDao {
        Listing memory listing = listings[_listingId];
        require(listing.id > 0, "Invalid listing");
        require(
            listings[_listingId].seller == msg.sender,
            "Only owner can cancel"
        );
        address nftAddress = listing.nftAddress;
        uint256 tokenId = listing.tokenId;
        _removeListing(_listingId);
        emit ListingCanceled(
            _listingId,
            nftAddress,
            tokenId,
            msg.sender
        );
    }

    function _removeListing(uint _listingId) internal{
        Listing memory listing = listings[_listingId];
        Node memory node = Nodes[_listingId];
        uint256 front = node.front;
        uint256 next = node.next;
        delete Nodes[_listingId];
        Nodes[front].next = next;
        Nodes[next].front = front;
        delete nftToIndex[listing.nftAddress][listing.tokenId];
        delete listings[_listingId];
    }

    function endAuction(uint256 _listingId) external {
        Listing memory listing = listings[_listingId];
        require(block.timestamp > listing.endTimestamp,"Can not finish the auction yet");
        require(listing.highestBidder != address(0),"there is currently no bid");
        IERC721(listing.nftAddress).safeTransferFrom(
            listing.seller,
            msg.sender,
            listing.tokenId
        );
        IERC20(VicAddress).transfer(listing.seller, listing.highestBidPrice);
        uint price = listing.highestBidPrice;
        uint tokenId = listing.tokenId;
        _removeListing(_listingId);
        emit NftSold(_listingId, listing.nftAddress, tokenId, vicDAO, msg.sender, price);
    }

    function buyNFT(uint256 _listingId, uint _price) external {
        Listing memory listing = listings[_listingId];
        require(_price == (listing.price * 9) / 10,"Invalid price");
        require(listing.id > 0, "Invalid listing");
        require(
            block.timestamp > listing.endTimestamp &&
                block.timestamp < listing.endTimestamp + 48 hours,
            "Listing expired"
        );
        IERC20(VicAddress).transfer(listing.seller, _price);
        IERC721(listing.nftAddress).safeTransferFrom(
            listing.seller,
            msg.sender,
            listing.tokenId
        );
        uint tokenId = listing.tokenId;
        _removeListing(_listingId);
        emit NftSold(_listingId, listing.nftAddress, tokenId, vicDAO, msg.sender, _price);
    }

    function unsold(uint256 _listingId) external {
        Listing memory listing = listings[_listingId];
        require(block.timestamp>listing.endTimestamp + 48 hours,"the current time cannot be unsold");
        address nftAddress = listing.nftAddress;
        uint256 tokenId = listing.tokenId;
        uint256 price = listing.price;
        _removeListing(_listingId);
        emit Unsold(_listingId,nftAddress,tokenId,price);
    }

    function getExpiredListingWithoutBid() view external returns (uint) {
        uint256 count;
        uint256 quantity;
        uint256 timestamp = block.timestamp;
        while (Nodes[Nodes[count].next].createTime > timestamp + 48 hours) {
            quantity ++;
            count = Nodes[count].next;
        }
    }
}

